import React, { Component } from "react";
// import { fixImagePath } from "../../services/utils";
import clsx from "clsx";

const config = {
  // If the image gets within 50px in the Y axis, start the download.
  root: null,
  rootMargin: "0px",
  threshold: 0.1
};
// const dummy = fixImagePath("/data/lazy.jpg");
const dummy = 'data:image/gif;base64,';

class ReactLazyCardMedia extends Component {
  constructor(props) {
    super(props);
    // this.state = {   src: this.props.image };
    this.image = React.createRef();
  }
  componentDidMount() {
    const $this = this;
    let observer;

    if ($this.props.delay) {
      setTimeout(() => {
        $this.image.current.classList.add("monitored");
        $this.image.current.classList.add("show");
        $this.image.current.src = $this.image.current.dataset.src;
      }, $this.props.delay);
    } else if (!("IntersectionObserver" in window)) {
      $this.image.current.classList.add("monitored");
      $this.image.current.classList.add("show");
      $this.image.current.src = $this.image.current.dataset.src;
    } else {
      observer = new IntersectionObserver($this.onIntersection, config);
      observer.observe($this.image.current);
    }    
  }
  componentDidUpdate(prevProps, prevState, snapshot) {
    if (this.props.image !== prevProps.image) {
      this.image.current.src = this.props.image;
    }
  }
  onIntersection(entries, obs) {
    let entry = entries[0],
      img = entry.target;

    if (img.classList.contains("monitored")) {
      obs.disconnect();
    }
    if (entry.intersectionRatio > 0) {
      img.classList.add("monitored");
      img.src = img.dataset.src;
      
      img.classList.add("show");
      obs.unobserve(img);
    }
  }
  render() {
    const $this = this;
    //const classes = $this.props.classes;
    return (
      <img
        ref={this.image}
        className={clsx($this.props.className, "fade")}
        src={dummy}
        data-src={$this.props.image}
        alt={$this.props.alt ? $this.props.alt : ""}
        title={$this.props.title ? $this.props.title : ""}
      />
    );
  }
}

export default ReactLazyCardMedia;
